// Mock Extension Manager for Local Testing
(function() {
    if (!window.tdgchart || !tdgchart.extensionManager) return;

    // Save the original register method
    var originalRegister = tdgchart.extensionManager.register;
    
    // Override only the register method
    tdgchart.extensionManager.register = function(config) {
        console.log('[Mock] Register called for:', config.id);
        window.chartConfig = config; // Save for test.html to use

        // 1. Load CSS
        if (config.resources && config.resources.css) {
            config.resources.css.forEach(function(cssPath) {
                var link = document.createElement('link');
                link.rel = 'stylesheet';
                link.href = cssPath;
                document.head.appendChild(link);
                console.log('[Mock] Loaded CSS:', cssPath);
            });
        }

        // 2. Load Scripts
        if (config.resources && config.resources.script) {
            config.resources.script.forEach(function(scriptPath) {
                var script = document.createElement('script');
                script.src = scriptPath;
                document.head.appendChild(script);
                console.log('[Mock] Loaded Script:', scriptPath);
            });
        }

        // 3. Initialize
        var successCallback = function(){
            console.log('[Mock] initCallback completed');
        };
        if(config.initCallback) {
            config.initCallback(successCallback, config);
        }
    };
})();
